curl -X POST \
'https://www.wixapis.com/oauth-app/v1/oauth-apps' \
-H 'Authorization: <AUTH> \
-H 'Content-Type: application/json' \
-d '{
  "oAuthApp": {
    "name": "Test app",
    "description": "Some test app"
  }
}'

